import TableContact from "./Layout/TableContact/TableContact";

const contacts = [
  { id: 1, name: 'Имя1 Фамилия ', email: "qwe1@gmail.com"},
  { id: 2, name: 'Имя2 Фамилия ', email: "qwe2@gmail.com"},
  { id: 3, name: 'Имя3 Фамилия ', email: "qwe3@gmail.com"},
  { id: 4, name: 'Имя4 Фамилия ', email: "qwe4@gmail.com"},
]

const App = () => {
  return (
    <div className="container mt-3">
      <div className="card">
        <div className="card-header">
          <h1>Список контактов</h1>
        </div>
        <div className="card-body">
          <TableContact />
        </div>
      </div>
    </div>
  );
}

export default App;
